/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; padding: 20px; }

/* Test-specific CSS */
.container {
    width: 400px;
    height: 300px;
    border: 2px solid #333;
    padding: 20px;
    position: relative;
}
.inline-table {
    display: inline-table;
    border: 2px solid #666;
    border-spacing: 5px;
    margin: 10px;
    vertical-align: top;
}
.row {
    display: table-row;
}
.cell {
    display: table-cell;
    padding: 8px;
    box-sizing: border-box;
    text-align: center;
    font-size: 12px;
    border: 1px solid #999;
}
.table1 .cell:nth-child(1) { background-color: #ffcccc; }
.table1 .cell:nth-child(2) { background-color: #ccffcc; }
.table2 .cell:nth-child(1) { background-color: #ccccff; }
.table2 .cell:nth-child(2) { background-color: #ffffcc; }
